#include<iostream>
#include<string>
#include<unordered_map>
#include<utility>

using namespace std;



int uniqIdx(string& s) {

	char c;
	long min = 1e9;
	int atleast = 0;
	unordered_map <char, pair<int, int>> umap;

	for (int i = 0; i <s.length(); i++) {
		c = s[i];
		umap[c].first = i;
		umap[c].second++;
	}
	for (auto ele : umap) {
		if(ele.second.second == 1) {
			atleast = 1;
			if (ele.second.first < min) {
				min = ele.second.first;
			}
		}
	}
	if (!atleast) return -1;

	return min+1;
}

int main() {

	//string s="";
	string s = "";
	
	/*cout << "enter the string : " << endl;
	cin >> s;*/

	cout << uniqIdx(s);
}
